script: |
  super -f text -I q11307.spq | sort > q11307.out

inputs:
  - name: q11307.spq
    data: |
      SELECT + col0 AS col0 FROM tab0 (FORMAT parquet) WHERE ( NOT NULL NOT IN ( CAST ( + col1 AS INTEGER ) * col1 * + col2, - 96, - CAST ( - + col2 AS INTEGER ) * - - col1, - col2 * + col0 + 96 / - - CAST ( col0 AS REAL ) + + col0 - col0, - - col0 ) );
  - name: tab0

outputs:
  - name: q11307.out
    data: |
